const LOCALE = "locale";

const dataLocalStorage = {
  setLocale(locale) {
    localStorage.setItem(LOCALE, locale);
  },
  getLocale() {
    return localStorage.getItem(LOCALE);
  },
};
export default dataLocalStorage;
